import React from 'react';
import { makeStyles } from '@material-ui/core/styles';
import AppBar from '@material-ui/core/AppBar';
import Toolbar from '@material-ui/core/Toolbar';
import Typography from '@material-ui/core/Typography';
import Button from '@material-ui/core/Button';
import IconButton from '@material-ui/core/IconButton';
import MenuIcon from '@material-ui/icons/Menu';
const Header = () => {
    return (
        // <div className="main-header">
        //     <div className="header">
        //         <div className="header-logo">logo</div>
        //         <div className="menu">
        //             <div className="menu-item">Startsida</div>
        //             <div className="menu-item">Om mig</div>
        //             <div className="menu-item">Kompetens</div>
        //             <div className="menu-item">Erfarenhet</div>
        //             <div className="menu-item">Portofölj</div>
        //             <div className="menu-item">Kontakt</div>
        //         </div>
        //     </div>
        // </div>
        <AppBar position="static">
            <Toolbar>
                <IconButton edge="start" className={classes.menuButton} color="inherit" aria-label="menu">
                    <MenuIcon />
                </IconButton>
                <Typography variant="h6" className={classes.title}>
                    News
    </Typography>
                <Button color="inherit">Login</Button>
            </Toolbar>
        </AppBar>
    );
};

export default Header;
